import React from "react";
import init from "./init";

export default class WebGL extends React.Component {
  componentDidCMount() {
    init("2d");
  }

  render() {
    return (
      <canvas
        id="webgl"
        width="400"
        height="400"
        style={{ border: "1px solid blue" }}
      ></canvas>
    );
  }
}
